    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT col1 + - 8 IN ( + 11, col0 - + 26 + 71, + col2 * + col0 + + 34 ) AND col1 * + + col1 + + col1 IS NULL;
  - name: tab2

outputs:
  - name: q5539.out
    data: |
